import React from "react";
import Weather from "../Weather/Weather";
import Homepage from "../Homepage/Homepage";
import SignIn from "../SignIn/SignIn";
import Contact from "../Contact/Contact";
import YourTour from "../YourTour/YourTour";
import { useState } from "react";
import Hamburger from "./Hamburger";
import NoBurger from "./NoBurger";
import ProblemSigningIn from "../SignIn/ProblemSigningIn";

const NavBar = () => {
	const [page, setPage] = useState(1);
	const [token, setToken] = useState(localStorage.getItem("token"));

	return (
		<>
			<div className="hamburger">
				<Hamburger page={page} setPage={setPage} />
			</div>

			<div className="noBurger">
				<NoBurger page={page} setPage={setPage} />
			</div>
			<div>
				{console.log(token)}
				{(() => {
					if (token == null) {
						<SignIn setPage={setPage} />;
					} else if (token != null && page === 2) {
						return <Homepage />;
					} else if (page === 3) {
						return <Weather />;
					} else if (page === 4) {
						return <YourTour />;
					} else if (page === 5) {
						return <Contact />;
					} else {
						return <SignIn />;
					}
				})()}
			</div>
			{/* {page === 0 && <ProblemSigningIn setPage={setPage} />}
			{token == null && page === 1 && <SignIn setPage={setPage} />}
			{token !== null && page === 2 && <Homepage />}
			{token !== null && page === 3 && <Weather />}
			{token !== null && page === 4 && <YourTour />}
			{token !== null && page === 5 && <Contact />} */}
		</>
	);
};

export default NavBar;
